To find the specific item in a sorted array of numbers, use the binary search algorithm. This algorithm works by dividing the array into two halves based on the value of the item you're searching for, and then recursively searching in one of the halves until you find the item or determine that it is not present.

Here's a pseudocode implementation of the algorithm:
```python
def binary_search(array, value):
    # split array into two halves based on value
    left, right = 0, len(array) - 1
    # if array is empty or value is less than first element
    if left == right:
        return False

    if array[left] < value:
        # if left half is empty, search right half
        if right == len(array) - 1:
            return False
        else:
            return binary_search(array, value, left + 1, right)

    elif array[right] > value:
        # if right half is empty, search left half
        if left == 0:
            return False
        else:
            return binary_search(array, value, left, right - 1)

    else:
        # if item found, return its index
        return left
```

The binary search algorithm uses a divide and conquer approach to quickly find the item in the sorted array. By splitting the array into two halves and recursively searching in one of the halves until you find the item or determine that it is not present, you can quickly locate the item in a large sorted array.
